import React from "react";

const Button = ({ text, color, onClick }) => {
  return (
    <button
      className={`${color} hover:bg-green-600 text-white font-semibold py-2 px-4 rounded`}
      onClick={onClick}
    >
      {text}
    </button>
  );
};

export default Button;
